import 'bootstrap/dist/css/bootstrap.min.css';

import React, {Component} from 'react'
import {
  Navbar,NavbarBrand, NavItem, NavbarText
} from 'reactstrap';

class Tool extends Component {
    constructor(props) {
        super(props);
    this.state = {
        myToolArgs: props.tools
     }
    }

    render () {
        return (
            <tr >
                <td>this.state.myToolArgs[0]</td>
                <td>this.state.myToolArgs[1]</td>
                <td>this.state.myToolArgs[2]</td>
                <td>this.state.myToolArgs[3]</td>
                <td>this.state.myToolArgs[4]</td>
                <td>this.state.myToolArgs[5]</td>
                <td>this.state.myToolArgs[6]</td>
                <td>this.state.myToolArgs[7]</td>
                <td>this.state.myToolArgs[8]</td>
            </tr>
        )
    }

}
export default Tool;
